CREATE TABLE Uzytkownicy (
    numerID INT PRIMARY KEY,
    email VARCHAR(100),
    haslo VARCHAR(50),
    imie VARCHAR(50),
    drugie_imie VARCHAR(50),
    nazwisko VARCHAR(50),
    data_urodzenia DATE,
    pesel CHAR(11),
    plec CHAR(1),
    narodowosc VARCHAR(50),
    miejsce_urodzenia VARCHAR(100),
    miejsce_zamieszkania VARCHAR(100),
    imie_matki VARCHAR(50),
    imie_ojca VARCHAR(50)
);

